import React, { Fragment } from "react";
import Login from "./components/login";
import GlobalStyle from "./styles/global";

const App = () => (
  <Fragment>
    <GlobalStyle />
    <Login />
    <h1> It's alive </h1>
  </Fragment>
);

export default App;
